CREATE TABLE ce (
  Seq bigint(20) NOT NULL auto_increment,
  Localidade varchar(50) default NULL,
  Nome varchar(70) default NULL,
  BAI_INI varchar(72) default NULL,
  BAI_FIM varchar(72) default NULL,
  CEP varchar(9) NOT NULL default '',
  COMPLEMENTO varchar(100) default NULL,
  LOGRADOURO varchar(20) default NULL,
  SemAcento varchar(70) default NULL,
  LocalidadeSemAcento varchar(50) default NULL,
  Bai_IniSemAcento varchar(72) default NULL,
  Bai_FimSemAcento varchar(72) default NULL,
  PRIMARY KEY  (Seq),
  KEY idx_log_loc1 (Localidade,SemAcento)
) TYPE=MyISAM;

